Amazing Spider-Man Presents - Black Cat 01-04 (2010|Digital|AnPymGold-Empire)

Promotional info - &quot;The Cat is B(l)ack in her own series and it's international intrigue at its sexiest by Jen Van Meter (Hopeless Savages, JSA) and Javier Pulido (AMAZING SPIDER-MAN). As Spider-Man is stalked during the Grim Hunt, the world's slyest, smartest and sneakiest jewel thief's latest heist puts the Black Cat face-to-face with the family that has been terrorizing Spider-Man's dreams and threatening those closest to him!&quot;

These are all four issues in digital copies thanks to AnPymGold-Empire. Please seed, and enjoy. 

